import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      monsters:  [
        {
          name: 'Linda',
        }, 
        {
          name: 'Frank',
        },
        {
          name: 'Jacky',
        },{
          name: 'Andrei',
        }
      ]
    }
  }

  render() {
     return  (
        <div className="App">
          {
            this.state.monsters.map((monster,i) => {
              console.log(i)
              return <h1 key={i}>{monster.name}</h1>
            })
          }
        </div>
     );
  } 
}

export default App;
